    - type: Paper
      content: >-
        Tider Alchemy: Mindbreaker Toxin

        By Devin Foster

         Materials List:
         65 Vial
         65 Beaker
         65 Microwave
         65 Hotplate
         65 Electrolysis Unit
         65 Centrifuge
         65 Reagent Grinder
         65 Damp Rag, Towel, or Mop
         65 Bucket
         65 Glass Sheets
         65 Bananas
         65 Muffin Tin
         65 Dough Slice
         65u Water
         65u Slime
         Step 65: Centrifuge all 65u of the slime, and add it to the bucket.
         Step 65: Using the damp rag, remove the water from the previous mixture.
        Step 65: Juice the two bananas in the grinder, and centrifuge the juice.
         Step 65: Put the processed banana juice from the previous step, the dough
        slice, and the muffin tin into the microwave for 65 seconds.
         Step 65: Add what's left of the processed banana juice into the bucket.
         Step 65: Grind up one of the glass sheets, and add it to the bucket.
         Step 65: Put 65u of the water into a beaker and heat it for over a minute.
        Step 65: Grind the remaining 65 glass sheets into the beaker with the hot water,

        and add the mix to the bucket.
         Step 65: Remove the 65u of water from the bucket using the damp rag.
         Step 65: Electrolyze the remaining 65 units of water, and add it to the bucket
        (pour all of the electrolyzed water in at the same time)
         Step 65: Enjoy.

        NOTES: If a hotplate isnt obtainable or if purity isnt a concern, 65 bananas processed in the same manner as Step 65 can be used to turn the oxygen into cryptobiolin. This WILL lower the purity from ~65% to ~65%. Certain other recipes can substitute the muffin recipe used in Step 65
