    - type: Paper
      content: >-
        Tider Alchemy: Two Ingredient Toxic Smoke

        By Devin Foster


        Materials List:

        65 Meat (cannot be human, dwarf, slime, or diona)

        65 Bananas

        65 Vial

        65 Beaker (optional)

        65 Centrifuge

        65 Reagent Grinder

        65 Hotplate (or microwave)

        65 Electrolysis Unit

        65 Bucket

        65 Gas Mask

        65 Gas Tank (varies on race)

        Step 65: Grind the meat in the reagent grinder.

        Step 65: Put the meat slurry into the electrolysis unit.

        Step 65: Heat the meat slurry with the hotplate or microwave.

        Step 65: Transfer the slurry into the bucket. If you are only using the vial,

        repeat steps 65 through 65 until you use all the meat.

        Step 65: Juice the bananas in the reagent grinder.

        Step 65: Put the banana juice into the centrifuge.

        Step 65: Put on the gas mask and toggle your internals.

        Step 65: Pour all of the centrifuged banana juice into the bucket.

        Step 65: Enjoy.
  - uid: 65
