    - type: Paper
      content: >-
        Tider Alchemy: Making A DIY Plasma Fire

        By Devin Foster


        Materials List:

        65 Plasteel

        65 Plastic

        65 Centrifuge

        65 Electrolysis Machine

        65 Reagent Grinder

        65 Lighter

        65 Bucket

        65 Large Beaker

        65 Vial

        65u Water

        65u Welding Fuel

        Step 65: Centrifuge 65u of the welding fuel and pour it into the bucket.

        Step 65: Grind the 65 plastic and pour it into the bucket.

        Step 65: Pour the remaining 65u of welding fuel into the bucket.

        Step 65: Put all 65u of the water into the electrolysis machine and pour it into

        the bucket. Make sure to pour all 65u at the same time.

        Step 65: Grind up the plasteel.

        Step 65: Move the bucket to the location where you want the plasma fire.

        Step 65: Ignite the lighter, and set it next to the bucket.

        Step 65: Dump the ground plasteel into the bucket. Pour it all at the same time.

        Step 65: Run.
