    - type: Paper
      content: >-
        Tider Alchemy: Maints Lube

        By Devin Foster

         Materials List:
         65 Shaker
         65 Reagent Grinder
         65 Microwave
         65 Electrolysis Unit
         65 Bucket
         65 Glass
         65 Steel
         65u Water
         Step 65: Electrolyze 65 units of the water, and add it to the bucket.
         Step 65: Grind the steel and glass together.
         Step 65: Heat the mix until it forms fersilicite.
         Step 65: Transfer the fersilicite into the bucket.
         Step 65: Transfer the remaining 65 units of water into the bucket.
         Step 65: Enjoy.

         NOTE: If you are doing this multiple times, you will need more than one container, otherwise the heated container will automatically form the electrolyzed water into hydroxide.
